import React from 'react';
import Search from './Search.js';
import Nav from './Nav.js';
import "./index.css";

const App = (props) => {
  return (
    <Routes>
      <div>
        <Nav />
        <Route path='/' element={<SearchForm />}/>
        <Route path='/search/:query' element={<Results />}/>
        <Route path='/search/:query/:id' element={<ResultDetails />}/>
      </div>
    </Routes>
  );
}

export default App;
